description:
The Hand of Thrawn Duology comprises two novels, Specter of the Past, and Vision of the Future, both written by Timothy Zahn. Set in 19 ABY, the two books explore the end of the Galactic Civil War. While some forces in the Imperial Remnant, led by Admiral Gilad Pellaeon, attempt to make peace with the New Republic, another group, led by Moff Disra and an apparently resurrected Grand Admiral Thrawn, attempts to destabalize the New Republic. They do this by bringing to light the Caamas Document, containing evidence that the Bothans were guilty of helping Emperor Palpatine all but exterminate the Caamasi people. Meanwhile, Mara Jade and Luke Skywalker investigate a mysterious fortress at the edge of the galaxy. 

